    FEC report discloses on Line 16 a refund in the amount of $2,000 from Help Unite
    Republicans Today Political Action Committee (Hurt PAC).  In a Form 99 Miscellaneous
    Report filed by WellPAC on January 11, 2013 in response to an RFIA from the FEC,
    WellPAC noted that a contribution made payable to Robert Hurt for Congress was
    mistakenly deposited by the Hurt campaign into the account of Hurt PAC, a leadership
    PAC sponsored by Rep. Hurt.  The Line 16 transaction included on this report is
    the refund of the contribution that was mistakenly deposited into the account
    of Hurt PAC.    \n"
